import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';

function Phonenav({ setSelectedBrand }) {
  // List of headphone brands to map over
  const brands = ['boAT', 'OnePlus', 'JBL', 'Boult', 'Sony', 'realme', 'ZEBRONICS', 'Samsung', 'Noise', 'pTron'];

  // Initialize useNavigate hook for programmatic navigation
  const navigate = useNavigate();

  const handleBrandClick = (brand) => {
    setSelectedBrand(brand);
    navigate(`/headphones/${brand.toLowerCase()}`); // Navigate to the brand's page
  };

  return (
    <Navbar fixed="top" collapseOnSelect expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="/dashboard">HeadPhones</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            {/* Directly map over the brands array without filtering */}
            {brands.map((brand) => (
              <Nav.Link 
                as={Link} 
                to={`/headphones/${brand.toLowerCase()}`}  // Corrected path for brand navigation
                key={brand}
                onClick={() => handleBrandClick(brand)} 
              >
                {brand.charAt(0).toUpperCase() + brand.slice(1)}  {/* Capitalizing first letter */}
              </Nav.Link>
            ))}
          </Nav>
          <Nav>
            <Link to='/dashboard'>
              <p className="m-0">Back</p> {/* Use m-0 to remove default margin on <p> */}
            </Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Phonenav;
